import React from 'react';

import TableTr from './components/TableTr';

const Table = () => {

    const data = [
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ],
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ],
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ],
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ]
    ];

    return (
        <table>
            <TableTr />
            <tr>
                {data[1]}
            </tr>
            <tr>
                {data[2]}
            </tr>
        </table>
    );
};

export default Table;
